class Type(Generic[CT_co]):
    u"""A special construct usable to annotate class objects.
    
    For example, suppose we have the following classes::
    
      class User: ...  # Abstract base for User classes
      class BasicUser(User): ...
      class ProUser(User): ...
      class TeamUser(User): ...
    
    And a function that takes a class argument that's a subclass of
    User and returns an instance of the corresponding class::
    
      U = TypeVar('U', bound=User)
      def new_user(user_class: Type[U]) -> U:
          user = user_class()
          # (Here we could write the user object to a database)
          return user
    
      joe = new_user(BasicUser)
    
    At this point the type checker knows that joe has type BasicUser.
    """
    __slots__ = ()
    __extra__ = type


def NamedTuple(typename, fields):
    u"""Typed version of namedtuple.
    
    Usage::
    
        Employee = typing.NamedTuple('Employee', [('name', str), ('id', int)])
    
    This is equivalent to::
    
        Employee = collections.namedtuple('Employee', ['name', 'id'])
    
    The resulting class has one extra attribute: _field_types,
    giving a dict mapping field names to types.  (The field names
    are in the _fields attribute, which is part of the namedtuple
    API.)
    """
    fields = [ (n, t) for n, t in fields ]
    cls = collections.namedtuple(typename, [ n for n, t in fields ])
    cls._field_types = dict(fields)
    try:
        cls.__module__ = sys._getframe(1).f_globals.get(u'__name__', u'__main__')
    except (AttributeError, ValueError):
        pass

    return cls


def NewType(name, tp):
    u"""NewType creates simple unique types with almost zero
    runtime overhead. NewType(name, tp) is considered a subtype of tp
    by static type checkers. At runtime, NewType(name, tp) returns
    a dummy function that simply returns its argument. Usage::
    
        UserId = NewType('UserId', int)
    
        def name_by_id(user_id):
            # type: (UserId) -> str
            ...
    
        UserId('user')          # Fails type check
    
        name_by_id(42)          # Fails type check
        name_by_id(UserId(42))  # OK
    
        num = UserId(5) + 1     # type: int
    """

    def new_type(x):
        return x

    new_type.__name__ = str(name)
    new_type.__supertype__ = tp
    return new_type


